import React from "react";

function app() {
    return ( <
        div >
        <
        section style = {
            { height: "300px", backgroundColor: "green", }
        } >
        <
        h1 style = {
            { backgroundColor: "blue", color: "white", textAlign: "center", marginLeft: "20px", marginTop: "10px" }
        } > Malek guedda 's portfolio</h1> < /
        section > <
        p >
        is this website you 're going to learn more about me, see the demos of my previous work, source codes , ideas projects, quotes and a lot more ! < /
        p >

        <
        p > So Stay tuned Guys, i love you all, .peace! < /p>

        <
        /div>
    );
}
export default app;
